{{otheruses|the regular type of tree patch|fruit tree patches|Fruit tree patch}}
'''Tree patches''' are [[farming patch]]es used by players to grow their own personal [[tree]]s. Much like other [[trees]], these can be chopped using the [[Woodcutting]] [[skill]] to obtain [[logs]]. The necessary [[tree seed]]s to grow them must be obtained from [[bird nest]]s or other sources. Planted trees do not require watering.

First, an empty [[plant pot]] may be used on any empty farming patch with a [[gardening trowel]] to fill the [[plant pot]] with soil. Plant '''one''' tree seed on the pot with the [[gardening trowel]] and water it with a [[watering can]]. After a few minutes, the seedling will grow into a sapling which can then be planted in a cleared tree patch; players must have a [[spade]] in their inventory when planting and removing the stump of a tree.

Before or after transplanting the sapling, the player can add [[compost]], [[supercompost]], or [[ultracompost]] to the patch to reduce chance of disease. Alternatively, they can pay the nearby farmer to look after it to completely eliminate disease-risk; seedlings and saplings are unable to become diseased while growing in a plant pot. If a tree becomes diseased, using [[secateurs]] or [[magic secateurs]] on it to prune the diseased leaves will bring it back to a healthy state and will yield [[Leaves (disambiguation)|leaves]].

To plant a new tree the old one needs to be cleared from the patch. This can be done by chopping it down and digging up the [[roots]] or by paying the farmer 200 coins to remove it. Only a small amount of [[Farming]] [[experience]] is gained planting the [[Tree sapling|sapling]], with the vast majority gained from checking on the tree's health much like with [[Bush patch|bushes]].

